import React, { useState } from "react";

const Cell = (input) => {

    let max = 36;
    let min = 1;
    let value = Math.floor(Math.random() * (max - min) + min);

    const [active, setActive] = useState(false);

    const handleClick = () => {
      setActive(!active);
    };

    return (
        <th onClick={handleClick}>{value}</th>
     );
}

export default Cell;
